import web3 from "./web3";

const address = "0xCC74904Ae4C24Fc5641E7b9613de00a9Bd264b57";

const abi = [
  {
    constant: false,
    inputs: [{ name: "newMessage", type: "string" }],
    name: "setMessage",
    outputs: [],
    payable: false,
    stateMutability: "nonpayable",
    type: "function",
  },
  {
    constant: true,
    inputs: [],
    name: "message",
    outputs: [{ name: "", type: "string" }],
    payable: false,
    stateMutability: "view",
    type: "function",
  },
  {
    inputs: [{ name: "initialMessage", type: "string" }],
    payable: false,
    stateMutability: "nonpayable",
    type: "constructor",
  },
];

export default new web3.eth.Contract(abi, address);
